import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'ZadanieRekrutacyjne';
  joke = new Joke(1, "z pół obrotu");
  //joke =  fetchJoke('http://api.icndb.com/jokes/random')

}

async function fetchJoke(url:string) {
  fetch(url).then(function (response){
    return response.json();
  }).then(function(myJson){
    let Data = myJson;
    console.log("Id: ",Data.value[0].id);
    console.log("Joke: ",Data.value[0].joke);
    const tmp = new Joke(Data.value[0].id,Data.value[0].joke)
    return tmp

  })
}
class Joke
{
  public id: number = -1;
  public content: string = '';
  constructor(id:number, content:string)
  {
    this.id = id;
    this.content = content;
  }

}

